import logo from './logo.svg';
import './App.css';
import LandingPage from './LandingPage'

function App(){
  return(
    <BrowserRouter>
      <div>
        <Switch>
          <Route path="/" component={LandingPage} exact/>
        </Switch>
      </div>
    </BrowserRouter>
  );
}
export default App;
